import './Pagination.css';
import axios from "axios";

const Pagination = (props) => {
    const pages = props.page_count / props.page_size

    const componentDidMount = (pagr_number) => {
        axios.get(`http://192.168.100.8:8080/api/v1/profile?page=${pagr_number}`)
			.then(this.props.set_users)
			.catch(err => console.log(`FAIL ${err}`))
    }

    return <div className="pagination">
        {
            (() => {
                let items = []
                for (let item_num = 1; item_num <= pages; item_num++) {
                    items.push(
                        `<span className='pagination__item' 
                               onclick=${ componentDidMount(item_num) }>
                        ${ item_num }
                        </span>`
                    )
                }
                return items
            })()
        }
    </div>
}

export default Pagination;
